import ExpenseItem from "./ExpenseItem";
import "./ExpenseItems.css";

function ExpenseItems(props) {
  return (
    <Card className="expenses">
      {props.expenses.map((expense) => {
        return (
          <ExpenseItem
            title={expense.title}
            amount={expense.amount}
            date={expense.date}
          ></ExpenseItem>
        );
      })}
    </Card>
  );
}

export default ExpenseItems;
